import React from 'react';
import ReactDOM from 'react-dom';

class Footer extends React.Component {
   render() {
      return (
         <div id="footer" class="container-fluid">
           <div class="row">
             <div class="col-sm-4">
             </div>
            </div>
         </div>
      );
   }
}
export default Footer;
